UPDATE familias_cras
SET regiao_id = (
    SELECT r.regiao_id
    FROM regioes AS r
    WHERE r.nome_regiao = familias_cras.nome_regiao
)
WHERE nome_regiao IS NOT NULL;

UPDATE rede_municipal_escolas
SET bairro_popular_id = (
    SELECT b.bairro_popular_id
    FROM bairros AS b
    WHERE b.nome_bairro_popular = rede_municipal_escolas.nome_bairro_popular
)
WHERE nome_bairro_popular IS NOT NULL;

UPDATE rede_municipal_escolas
SET regiao_id = (
    SELECT r.regiao_id
    FROM regioes AS r
    WHERE r.nome_regiao = rede_municipal_escolas.nome_regiao
)
WHERE nome_regiao IS NOT NULL;

UPDATE abrangencia_saude
SET bairro_popular_id = (
    SELECT b.bairro_popular_id
    FROM bairros AS b
    WHERE b.nome_bairro_popular = abrangencia_saude.nome_bairro_popular
)
WHERE nome_bairro_popular IS NOT NULL;

UPDATE abrangencia_saude
SET regiao_id = (
    SELECT r.regiao_id
    FROM regioes AS r
    WHERE r.nome_regiao = abrangencia_saude.nome_regiao
)
WHERE nome_regiao IS NOT NULL;

UPDATE equipamentos_esportivos
SET bairro_popular_id = (
    SELECT b.bairro_popular_id
    FROM bairros AS b
    WHERE b.nome_bairro_popular = equipamentos_esportivos.nome_bairro_popular
)
WHERE nome_bairro_popular IS NOT NULL;

BEGIN TRANSACTION;
CREATE TABLE equipamentos_esportivos_new AS
SELECT 
    id_eq_esp,
    nome,
    nome_popular,
    tipo,
    nome_bairro_popular,
    complemento
FROM equipamentos_esportivos;
DROP TABLE equipamentos_esportivos;
ALTER TABLE equipamentos_esportivos_new RENAME TO equipamentos_esportivos;
COMMIT;

